import './Section3.css';
import Fleche_Bas from '../static/fleche_bas.svg';
import Fleche_Bas_Purple from '../static/fleche_bas_purple.svg';
import frigate from '../static/Frigate.svg';
import frigate_w from '../static/Frigate_white.svg';

const Section3 = () => {

    return(
        <div id="section2">
            <img className="down_arrow" alt="down arrow to go to resume" src={Fleche_Bas}  onClick={() => window.fullpage_api.moveSectionDown()}/>
            <img className="down_arrow da2" alt="down arrow to go to resume" src={Fleche_Bas_Purple}/>
            <h1 className="titre_sec3">Experience</h1>
            <h1 className="titre_sec3 ombre_sec3">Experience</h1>

            <section>
                <h2>Software Developer Apprentice at Naval Group</h2>
                <div>
                    <h2>Naval Group</h2>
                    <h3>The company that builds warships and submarines for the french navy and several foreign navies.</h3>
                </div>
                <h2>October 2019 to September 2022</h2>
                <h2>Development of a software for the optimization of electromagnetic fields on frigates.</h2>
                <div>
                    <h2>Technologies used</h2>
                    <h3>Pascal Object</h3>
                    <h3>Matlab</h3>
                    <h3>TCP/IP Communications</h3>
                </div>
            </section>
            <div className="animation_part">
                <img src={frigate_w} alt="frigate" className="frigate"/>
            </div>
        </div>
    );
}

export default Section3;
